import React from 'react';
import { View, Text, StyleSheet, TouchableOpacity, Linking } from 'react-native';
import { Ionicons } from '@expo/vector-icons';

interface CloudinaryConfigGuideProps {
  onClose: () => void;
}

const CloudinaryConfigGuide: React.FC<CloudinaryConfigGuideProps> = ({ onClose }) => {
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.title}>Configurar Cloudinary</Text>
        <TouchableOpacity onPress={onClose} style={styles.closeButton}>
          <Ionicons name="close" size={24} color="#666" />
        </TouchableOpacity>
      </View>

      <Text style={styles.subtitle}>
        Para subir imágenes necesitas una cuenta en Cloudinary
      </Text>

      <View style={styles.step}>
        <Text style={styles.stepNumber}>1</Text>
        <View style={styles.stepContent}>
          <Text style={styles.stepTitle}>Crea una cuenta gratis en Cloudinary</Text>
          <TouchableOpacity 
            style={styles.link}
            onPress={() => Linking.openURL('https://cloudinary.com/users/register/free')}
          >
            <Text style={styles.linkText}>Registrarse en Cloudinary</Text>
            <Ionicons name="open-outline" size={16} color="#005F9E" />
          </TouchableOpacity>
        </View>
      </View>

      <View style={styles.step}>
        <Text style={styles.stepNumber}>2</Text>
        <View style={styles.stepContent}>
          <Text style={styles.stepTitle}>Obtén tu Cloud Name</Text>
          <Text style={styles.stepDescription}>
            Ve al Dashboard de Cloudinary y copia tu "Cloud Name"
          </Text>
        </View>
      </View>

      <View style={styles.step}>
        <Text style={styles.stepNumber}>3</Text>
        <View style={styles.stepContent}>
          <Text style={styles.stepTitle}>Crea un Upload Preset</Text>
          <Text style={styles.stepDescription}>
            Ve a Settings → Upload → Upload Presets → Add Upload Preset
          </Text>
          <Text style={styles.stepDescription}>
            Establécelo como "Unsigned" y dale un nombre
          </Text>
        </View>
      </View>

      <View style={styles.step}>
        <Text style={styles.stepNumber}>4</Text>
        <View style={styles.stepContent}>
          <Text style={styles.stepTitle}>Actualiza el archivo de configuración</Text>
          <Text style={styles.stepDescription}>
            Edita <Text style={styles.code}>src/config/cloudinary.ts</Text> con tus datos:
          </Text>
          <View style={styles.codeBlock}>
            <Text style={styles.codeText}>
              CLOUD_NAME: "tu_cloud_name",{'\n'}
              UPLOAD_PRESET: "tu_upload_preset",
            </Text>
          </View>
        </View>
      </View>

      <TouchableOpacity style={styles.button} onPress={onClose}>
        <Text style={styles.buttonText}>¡Entendido!</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: 'white',
    borderRadius: 16,
    padding: 20,
    maxWidth: 500,
    width: '90%',
    elevation: 5,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
  },
  header: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: 16,
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#333',
  },
  closeButton: {
    padding: 5,
  },
  subtitle: {
    fontSize: 16,
    color: '#666',
    marginBottom: 20,
  },
  step: {
    flexDirection: 'row',
    marginBottom: 20,
  },
  stepNumber: {
    width: 30,
    height: 30,
    borderRadius: 15,
    backgroundColor: '#005F9E',
    color: 'white',
    textAlign: 'center',
    lineHeight: 30,
    fontWeight: 'bold',
    marginRight: 10,
  },
  stepContent: {
    flex: 1,
  },
  stepTitle: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#333',
    marginBottom: 4,
  },
  stepDescription: {
    fontSize: 14,
    color: '#666',
    marginBottom: 4,
  },
  link: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  linkText: {
    color: '#005F9E',
    marginRight: 4,
    textDecorationLine: 'underline',
  },
  code: {
    fontFamily: 'monospace',
    fontWeight: 'bold',
    color: '#333',
  },
  codeBlock: {
    backgroundColor: '#f5f5f5',
    padding: 10,
    borderRadius: 5,
    marginTop: 5,
  },
  codeText: {
    fontFamily: 'monospace',
    fontSize: 12,
    color: '#333',
  },
  button: {
    backgroundColor: '#4CAF50',
    padding: 12,
    borderRadius: 5,
    alignItems: 'center',
    marginTop: 10,
  },
  buttonText: {
    color: 'white',
    fontWeight: 'bold',
    fontSize: 16,
  },
});

export default CloudinaryConfigGuide;
